import React, { memo } from 'react';

const About = () => {
  return (
    <div className='About'>
      <h2>About</h2>
      <h1>Who I am</h1>
      <p>
        I am a software developer with a passion for creating beautiful, intuitive, and functional user interfaces. I have experience with React, Redux, TypeScript, JavaScript, HTML, CSS, Sass, Node.js, Express, MongoDB, and PostgreSQL. I am a quick learner and I am always looking to expand my knowledge and skill set.
      </p>
      <p>
        I am currently looking for a full-time position as a front-end developer.
      </p>
      <p>
        When I am not coding, I enjoy playing video games, watching movies, and playing with my dog.
      </p>
    </div>
  );
}

export default memo(About);
